import * as React from 'react';
import { Button, View, Text, StatusBar, StyleSheet} from 'react-native';

export default class MainFunctionScreen extends React.Component {
	render(){
		return(
            <View style={styles.Main_Function}>
                <StatusBar barStyle="dark-content" backgroundColor="#ecf0f1" />
                <Text>Control your smart socket here</Text>
 
                <Button
                    title="On Off"
                    onPress={() => this.props.navigation.navigate("OnOff")}
                />
 
                <Button
                    title="Scheduling"
                    onPress={() => this.props.navigation.navigate("SetTimer")}
                />

                <Button
                    title="Log Out"
                    onPress={() => this.props.navigation.navigate("Home")}
                />
            </View>
		)
	}
}

const styles = StyleSheet.create({
    Main_Function: {
        backgroundColor: '#90FF33',
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center' 
    }
});
